import { arrToBufArr, KECCAK256_NULL, KECCAK256_RLP } from '@ethereumjs/util'
import { RLP } from '../../../rlp/src'
import { Trie } from '../../src'

const data = Buffer.from('', 'hex')

function convertSlimAccount(body: any) {
	const cpy = [body[0], body[1], body[2], body[3]]
	if (arrToBufArr(body[2]).length === 0) {
		// StorageRoot
		cpy[2] = KECCAK256_RLP
	}
	if (arrToBufArr(body[3]).length === 0) {
		// CodeHash
		cpy[3] = KECCAK256_NULL
	}
	return arrToBufArr(RLP.encode(cpy))
}

const decoded = RLP.decode(data)

const accounts: any = decoded[1]
const proof = decoded[2]

const keys = accounts.map((e: any) => e[0])
const values = accounts.map((e: any) => convertSlimAccount(e[1]))


const trie = new Trie()

const root = Buffer.from('6990ad9c1ec7f2b4880aba38dc0d25b168a18600fe0a146db1d597ecb37e2a2f', 'hex')

async function go() {
    await trie.verifyRangeProof(root, keys[0], keys[keys.length - 1], keys, values, <any>proof)
}

go()